- input: "TEXT\x1CC00417402\x1C.TEXT\x1C\x1CF3A\x1CThis amendment is in response to
    the Commission's letter dated January 19, 2007. The Committee is currently undertaking
    an internal audit of their Pre-General and Post-General Reports.  Amendments will
    be filed with corrected Column B and beginning cash on hand figures once completed.
    \ Schedule C has been corrected to show all of the necessary loan information.
    \  Payments to credit card companies and reimbursements to individuals have been
    itemized to more clearly identify the original vendors for each payment.  Purpose
    fields and addresses for Schedule B of the Committee's report have been updated.
    This final amendment reflects a change in Total Disbursements due to the the removal
    of a few disbursements that were inavdertently reported in duplicate on the original
    report.\n"
